style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("amctv.com") {
  .tout-still {
    display: block;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    background: url(http://placekitten.com/605/345) no-repeat;
    width: 605px; /* Width of new image */
    height: 345px; /* Height of new image */
    padding-left: 605px; /* Equal to width of new image */
  }

  .series-container-videos .video-link img, #content .video-link img {
    display: block;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
    background: url(http://placekitten.com/290/165) no-repeat;
    width: 290px; /* Width of new image */
    height: 165px; /* Height of new image */
    padding-left: 290px; /* Equal to width of new image */
  }
 
}
